export const posts = [

  {
    title: "This Website",
    image: require('../fish.jpg'),
    caption: "This website was created to create a written record of my major projects. I used React and Material UI to create it in its current form. It is a continuous work in progress. "
  },

  {
    title: "GANs Car Generation",
    image: require('../gans.png'),
    caption: "The goal of this project is to create a GANs model which can produce images of sports cars. Challenges of this project include learning how to train an GANs model and using a small dataset."
  },

  {
    title: "DSM Street Car",
    image: require('../dsm.jpg'),
    caption: "1990 Mitsubishi Eclipse GSX - this car has a freshly rebuild engine with multiple upgrades. Still needs a lot of work but it's a great platform for making cheap power."
  },

  {
    title: "Camaro Drift Car",
    image: require('../ocean.jpg'),
    caption: "Lorem ipsum..."
  }
]
